class Dateshow extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time : new Date()
    };
  }

  render() {
    return (
      <div>
        <p>Date: {this.state.date.toString()} </p>
        <button onClick={() => this.setState({ date: new Date()})}>
          Click me for a date
        </button>
      </div>
    );
  }
}

export default Dateshow;
